import React from 'react';
import {navigation} from "../app_data/header_array";
import Inner_nav_item from "./inner_nav_item.jsx";

class Main_nav_item extends React.Component{
    render() {
        return(
            <div className={"container row "} id="menu">
                <ul className={"row"}>
                    {navigation.map((main_nav_item, i) => {
                            return(
                                <li className={"flex-column col-4"} key={i}>
                                    <h4>{main_nav_item.label}</h4>
                                    <Inner_nav_item inner_menu={main_nav_item.inner_menu}/>
                                </li>
                            )
                        }
                    )}
                </ul>
            </div>
        )
    }
}

export default Main_nav_item;
